import React from 'react';
import './App.css';
import HeaderComponent from './components/HeaderComponent';
import WorldDigitalClock from './components/WorldDigitalClock';



function App() {
  return (
    <div className="App">
      <h2>{HeaderComponent()}</h2>
      <WorldDigitalClock></WorldDigitalClock>
    </div>
  );
}

export default App;
